import React from "react";
import { Link } from "react-router-dom";
// import "./style.css";
function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <Link
        to="/"
        className={
          window.location.pathname === "/game" ? "nav-link active" : "nav-link"
        }
      ></Link>
    </nav>
  );
}
export default Navbar;
